import React from 'react'
import PropTypes from 'prop-types'
import { Navbar, NavItem } from "react-materialize"

function Nav(props) {
    return (
        <Navbar fixed="true" brand='Bryson Nelson' right>
            <NavItem href='get-started.html'>About Me</NavItem>
            <NavItem href='components.html'>Contact Me</NavItem>
            <NavItem href='components.html'>Portfolio</NavItem>
        </Navbar>
    )
}

export default Nav
